import CourseHero from '../components/Coursework/CourseHero.jsx';
import Footer from '../components/Footer/Footer.jsx';

const CourseWork = () => {
    return (
		<>
			<Navigation page="coursework" />
			<CourseHero />
			<Footer />
		</>
    );
}

export default CourseWork;
